class Solution(object):
    def maxRunTime(self, n, batteries):
        """
        :type n: int
        :type batteries: List[int]
        :rtype: int
        """
        def canRun(target):
            total = 0
            for battery in batteries:
                if battery > target:
                    total += target
                else:
                    total += battery
            if total / n >= target:
                return True
            else:
                return False

        left = 0
        right = sum(batteries) / n

        while left + 1 < right:
            middle = (left + right) // 2
            if canRun(middle):
                left = middle
            else:
                right = middle - 1

        if canRun(right):
            return right
        else:
            return left


